import React from 'react';
import './article.css';

const Article = ({imageUrl}) => {
    return (
        <div className="home__blog-container_article">
            <div className="home__blog-container_ariticle-image">
                <img src={imgUrl} alt="blog img"/>
            </div>
        </div>
    )
}

export default Article
